import React from 'react';
import PlanCard from './util/PlanCard';

function Plans() {
  return (
      <div className='plans'>
        <h1 className=''>Elevate Your Academic Writing</h1>
        <div className='plan-row'>
            <PlanCard 
                name='Free'
                amount='100'
                contains={['Create 2 exams', 'Create 1 user', 'Create 2 section per exam', 'Maximum 10 Questions in a section']}
            />
            <PlanCard
                name='Silver'
                amount='300'
                contains={['Create 2 exams', 'Create 1 user', 'Create 2 section per exam', 'Maximum 10 Questions in a section']}
            />
        </div>
      </div>
  );
}

export default Plans;
